import React from 'react';


//CSS FILES
import "../assets/vendor/aos/aos.css";
import "../assets/vendor/bootstrap/css/bootstrap.min.css";
import "../assets/vendor/bootstrap-icons/bootstrap-icons.css";
import "../assets/vendor/swiper/swiper-bundle.min.css";
import "../assets/css/style.css";


const PortfolioImage = (props) => (
    <>
        <div class=  {props.category + " item col-sm-12 col-md-6 col-lg-5 mb-4"}>
            <a class= "item-wrap fancybox">
                <img href={props.link} class="img-fluid" src={props.image}/>
            <div class="work-info">
                {/*<h3>{props.title}</h3>
                <span>{props.category}</span>*/}
                <img href={props.link} src = {props.company} class = "title-block mt-3"/>
                <h6 class = "description-block font mt-5">Empowering student video creators to hone storytelling</h6>

                <p class = "category description-block"> UI/UX Design | User Research </p>
            </div>
            </a>
        </div>

    </>
    );

export default PortfolioImage;
